import './App.css';
import Nav from "./Nav";
import Category from "./Category";
import Product from "./Product";
import {Container, Row} from 'reactstrap';
import React from "react";

function App() {
  return (
    <div className="App">
        <Nav/>
        <Category/>
        <Product/>
    </div>
  );
}

export default App;
